Ichabod en Meneer Pad


The Adventures of Ichabod and Mr. Toad bevat twee bewerkingen van bekende boeken. In het eerste
verhaal proberen Mr. Mole en Mr. Rat hun beste vriend Mr. Toad ervan te overtuigen dat hij zijn
roekeloze hobbies moet opgeven voordat hij de problemen komt. Helaas slaat Toad hun raad in de wind,
maar werkt zich een tijdje later flink in de problemen. In het tweede verhaal komt de slungelige
schoolmeester Ichabod Crane naar het dorpje Sleepy Hollow om les te geven aan de kinderen. Helaas
wordt hij al gauw op de hielen gezeten door de legendarische Headless Horseman.
